/*
 * Examples
 * (To see them, uncomment and save)
 */
atom-text-editor .cursor-line {
  background: #073642;
}
.minimap .cursor-line {
  background: green;
}
/* The rule for normal highlights */
.minimap .highlight-selected {
  background: green;
}
/* The rule for selected highlights */
.minimap .highlight-selected.selected {
  background: red;
}
atom-text-editor.is-focused::shadow ruler-view.rulerz {
  border-left: 1px solid rgba(147, 161, 161, 0.6);
}
